  generatePlattegrond() {
    const margins = {
      top: 15,
      bottom: 15,
      left: 10,
      right: 10,
    };

    const doc = new jsPDF();

    doc.text('PLATTEGROND', margins.bottom, margins.top);

    const imageURL =
      'data:image/png;base64,';

    doc.addImage(imageURL, 'JPEG', 0, 0, 0, 0);

    doc.save('PixelPalooza_Plattegrond');
  }

